  false,\n\t\"url\": null,\n\t\"notes\": \"Coastal water quality was measured at seven
  shoreline locations on the westnside of the Island of Hawaii and one site on Lanai,
  Hawaii during 1988-2011.nEach location had over 20 sub-sites for sampling. Most
  were sampled roughlyn4 times per year though some only once annually and other years
  with as manynas 11 observational visits. The water quality data comprise 14 parametersnand
  were collected using well-established instruments and methodologies.nParameters
  are aspects of water chemistry including turbidity. This setndoes not include measurements
  of bacteria. The data are stored innspreadsheets of the same format, with one file
  per location.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
